const httpService = "http://localhost:2000";

export const getBooks = async () => {
  try {
    const response = await fetch(`${httpService}/books`);
    const data = await response.json();
    return data;
  } catch (error) {
    console.error("Error fetching books:", error);
    return null;
  }
};

export const SignUpForUser = async ({payload}) => {
    try {
      const response = await fetch("http://localhost:2000/users/getUsers", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: payload, // Convert book object to JSON
      });

      const data = await response.json();
      console.log("User added:", data,payload);
      return data;
    } catch (error) {
      console.error("Error adding book:", error);
      return null;
